$_MODULE['<{pms_gopay_extra}prestashop>ordersetting_c1a8289933125def4d4e59dd4500dee3'] = 'Pre-authorized payments';
$_MODULE['<{pms_gopay_extra}prestashop>ordersetting_ce33499e4723be8bb943ec32a16930d3'] = 'Pre-authorization is a type of payment that provides blocking funds in the bank account of paying customer. At the moment of completion of payment on the payment gateway funds are not transferred to GoPay business account but is created blocking (pre-authorization) on the bank of paying customer. Blocking can be based on the trader instruction canceled or made a transaction as completed, ie. the transfer of blocked funds to GoPay business account. All operations with pre-authorized payments can be made for a period of 4 days from the establishment of payment. Only payment cards support pre-authorize payment.	';
$_MODULE['<{pms_gopay_extra}prestashop>ordersetting_b98f7375f44ee0c2d54320926a92788f'] = 'Recurrent payments';
$_MODULE['<{pms_gopay_extra}prestashop>ordersetting_b7bcbd34fcef65d8c0cb0af9cb973692'] = 'Recurring payment is a functionality that allows accepting payment from a customer on a regular basis. The customer is at the time of creating payment informed at the payment gateway of its parameters (amount, payment frequency, etc.). After the successful initialization, payment is paid automatically in the defined period or upon request. The customer is informed by e-mail about each completed payment. Merchant is informed through notification about the change in payment. Only payment cards support recurring payment.	';
